    <script type="text/javascript">
      !(function (o, c) {
        var n = c.documentElement,
          t = " w-mod-";
        (n.className += t + "js"),
          ("ontouchstart" in o ||
            (o.DocumentTouch && c instanceof DocumentTouch)) &&

  <body>
    <div class="utility-page-wrap">
      <div class="utility-page-content w-password-page w-form">
        <form
          method="post"
          action="/.wf_auth"
          id="email-form"
          name="email-form"
          data-name="Email Form"
          class="utility-page-form w-password-page"
        >
          <img
            src="https://d3e54v103j8qbb.cloudfront.net/static/password-page-lock.832ca8e2c9.svg"
            alt=""
          />
          <h2>Protected page</h2>
          <div style="display: none" class="w-password-page w-embed w-script">
            <input
              type="hidden"
              name="path"
              value="<%WF_FORM_VALUE_PATH%>"
            /><input type="hidden" name="page" value="<%WF_FORM_VALUE_PAGE%>" />
          </div>
          <input
            type="password"
            class="w-password-page w-input"
            autofocus="true"
            maxlength="256"
            name="pass"
            data-name="field"
            placeholder="Enter your password"
            id="field"
          /><input
            type="submit"
            value="Submit"
            data-wait="Please wait..."
            class="w-password-page w-button"
          />
        </form>
        <div class="w-password-page w-form-fail">
          <div>Incorrect password. Please try again.</div>
        </div>
        <div style="display: none" class="w-password-page w-embed w-script">
          <script type="application/javascript">
            (function _handlePasswordPageOnload() {
              if (/[?&]e=1(&|$)/.test(document.location.search)) {
                document.querySelector(
                  ".w-password-page.w-form-fail"
                ).style.display = "block";
              }
            })();
          </script>
        </div>
      </div>
    </div>
    <script
      src="https://d3e54v103j8qbb.cloudfront.net/js/jquery-3.5.1.min.dc5e7f18c8.js?site=629490c54ad41a816abf6b72"
